import React from "react";

function About() {
    return (
        <section className="card bio-card parallax" id="about">
            <div className="card-header glowBox page-header">
                About Me
            </div>
            <div className="card-body glowBox">
                <p>
                    I grew up in Hendersonville, NC. I have always enjoyed computers, technology, and creativity. </p>
                <p>
                    I am currently a student studying full-stack web development through Trilogy Education Services at UNC Chapel Hill. </p>
                <p>
                    My hobbies include hiking, kayaking, walking my dog, and listening to improv comedy podcasts. </p>
                <p>
                    My wife, Scarlett, and I live in Durham, NC with our dog, Darcy, and our thee backyard chickens, Lucy, Penny, and Mipsy. </p>
            </div>
        </section>
    );
}

export default About;
